import { Box, Button, Header, Heading, Text, Tab, Tabs } from 'grommet';
import { Hpe, Previous } from 'grommet-icons';
import React, {useState} from 'react';
import InputFormm from './InputFormm';
import InputForm2 from './InputForm2';
import InputForm3 from './InputForm3';
import InputForm4 from './InputForm4';
import InputForm5 from './InputForm5';
import InputForm6 from './InputForm6';
import InputForm7 from './InputForm7';
import App from './App';

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    Redirect
  } from "react-router-dom";




function TabsForm(props) {
    // const[state, setState]= useState();

    function Back() {
       return (<Switch>
        <Link to="/" component={App}/>
        </Switch>)     
      }

    return(
        <>
        <Router>
        <Header background="brand">
            <Box direction="row" gap="small" pad="medium">
                <Hpe color="White"/>
                <Text weight="bold">HPE</Text>
                <Text>Console</Text>
            </Box>
        </Header>  
        
        <Box alignSelf="center"  border={{ color: 'brand', size: 'medium' }} >
            <Box pad="small">
                <Button icon={<Previous />} alignSelf="start" primary label="Back" onClick={Back} />
            </Box>
            <Heading margin={{left: 'medium'}} >Customs Annexure</Heading>

            <Box direction="row" alignSelf="center" pad="medium"> 
                <Tabs>
                    <Tab title="Procurement Section">
                        <Box pad="medium"><InputFormm /></Box>
                    </Tab>
                    <Tab title="Forwarder Section">
                        <Box pad="medium">
                        <InputForm2 />
                        </Box>
                    </Tab>
                    <Tab title="CHA Section">
                        <Box pad="medium"><InputForm3 /></Box>
                    </Tab>
                    <Tab title="Supplier & Product Section">
                        <Box pad="medium"> <InputForm4 /> </Box>
                    </Tab>
                    <Tab title="Customs Section">
                        <Box pad="medium">
                        <InputForm5 />
                        </Box>
                    </Tab>
                    <Tab title="Invoice Remittance Section">
                        <Box pad="medium">
                        <InputForm6 />
                        </Box>
                    </Tab>
                    <Tab title="Asset-grave Section">
                        <Box pad="medium">
                        <InputForm7 />
                        </Box>
                    </Tab>
                </Tabs>
            </Box>
        </Box>
        </Router>
        </>
    );
}

export default TabsForm;
